import java.util.HashMap;
import java.util.Map;
import java.util.Scanner;
import java.util.Set;

public class equallyDistributedGroups {

    static int GCD(int a, int b){

        int divisor = Math.min(a, b);
        int dividend = Math.max(a, b);
        int remainder = Integer.MAX_VALUE;

        while(remainder > 0){
            remainder = dividend % divisor;
            dividend = divisor;
            divisor = remainder;
        }

        return dividend;
    }
    
    public static void main(String[] args) {
        
        Scanner sc = new Scanner(System.in);

        int t = sc.nextInt(); //number of test cases
        for(int i=0;i<t;i++){

            int n = sc.nextInt();
            int arr[] = new int[n];
            //input array
            for(int j=0;j<n;j++){
                arr[j] = sc.nextInt();
            }
            
            HashMap<Integer, Integer> map = new HashMap<>();
            // calculating frequency
            for(int j=0;j<n;j++){
                if(map.containsKey(arr[j])){
                    int val = map.get(arr[j]);
                    map.put(arr[j], val++);
                }else{
                    map.put(arr[j], 1);
                }
            }
            
            // calculating GCD
            int gcd = map.get(arr[0]); 
            Set<Map.Entry<Integer,Integer>> s = map.entrySet();
            for(Map.Entry<Integer, Integer> it: s){
                gcd = GCD(gcd, it.getValue());
            }
            
            // test condition
            if(gcd > 1){
                System.out.println("True");
            }else{
                System.out.println("False");
            }
        }
    }
}
